import { StatusBar } from 'expo-status-bar';
import React, { useState } from "react";
//import React from 'react';
import { Text, View, StyleSheet, ImageBackground, ScrollView, TextInput, Button, TouchableOpacity, SafeAreaView, FlatList, Image, Rating, AirbnbRating, Picker } from 'react-native';
import axios from "axios";
import FormData from "form-data";

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      name: "",
      businessName: "",
      email: "",
      mobileNumber: "",
      vertical: "",
      cr_number: "",
      city: "",
      country: "",
      password: ""
    }
  }

  submitHandle = () => {
    var data = new FormData();
    if (this.state.name == "") {
      //this.state.name.error = "please ender the name";
      alert("please ender the name")
    }
    else if (this.state.businessName == "") {
      alert("please ender the business name")
    }
    else if (this.state.email == "") {
      alert("please ender the email")
    }
    else if (this.state.mobileNumber == "") {
      alert("please ender the mobileNumber")
    }
    else if (this.state.vertical == "") {
      alert("please ender the vertical")
    }
    else if (this.state.cr_number == "") {
      alert("please ender the cr_number")
    }
    else if (this.state.city == "") {
      alert("please ender the city")
    }
    else if (this.state.country == "") {
      alert("please ender the country")
    }
    else if (this.state.password == "") {
      alert("please ender the password")
    }
    else {
      data.append('name', this.state.name);
      data.append('business', this.state.businessName);
      data.append('email', this.state.email);
      data.append('phone', this.state.mobileNumber);
      data.append('vertical', this.state.vertical);
      data.append('cr_no', this.state.cr_number);
      data.append('city', this.state.city);
      data.append('country', this.state.country);
      data.append('password', this.state.password);

      var BASE_URl = 'http://testing.demo2server.com/careapp/carcare/api/v1/';

      var config = {
        method: 'post',
        url: BASE_URl + 'sign-up',
        data: data
      };
      var me = this;
      axios(config)
        .then(function (response) {
          if (response.data) {
            if (response.data.status) {
              alert("Congratulations!")
              me.props.navigation.navigate("App");
            } else {
              alert("Oops, We can not find you.");
            }
          } else {
            alert("Something went wrong!");
          }
        })
        .catch(function (error) {
          console.log(error);
        });
    }

  }

  render() {
    const navigation = this.props.navigation;
    //const [selectedValue, setSelectedValue] = useState("java");
    return (
      <ImageBackground
        style={{
          width: "100%",
          height: "100%"
        }}
        resizeMode={'cover'}
        source={require('../assets/imgs/login/bg.png')}
      >
        <ScrollView>
          <View style={styles.container}>
            <Text style={styles.textHeading}> Sign Up </Text>
            <Text style={styles.textLabel}> Name </Text>
            <TextInput
              style={styles.textInput}
              placeholder="Enter Name"
              onChangeText={text => this.setState({ name: text })}
            />
            <Text style={styles.textLabel}> Business Name </Text>
            <TextInput
              style={styles.textInput}
              placeholder="Enter Business Name"
              onChangeText={text => this.setState({ businessName: text })}
            />
            <Text style={styles.textLabel}> Email </Text>
            <TextInput
              style={styles.textInput}
              placeholder="Enter Email"
              onChangeText={text => this.setState({ email: text })}
            />
            <Text style={styles.textLabel}> Mobile Number </Text>
            <TextInput
              style={styles.textInput}
              placeholder="Enter Mobile Number"
              onChangeText={text => this.setState({ mobileNumber: text })}
            />

            <Text style={styles.textLabel}> Vertical </Text>
            <View style={{ borderRadius: 4, borderWidth: 1, borderColor: 'gray', width: "94%", backgroundColor:'#ffffff' }}>
              <Picker 
              style={{height:36}}
              mode="dropdown"              
                //selectedValue={selectedValue}      
                onValueChange={(itemValue, itemIndex) => setSelectedValue(itemValue)}                        >
                <Picker.Item label="Select State" color="#B3B3B3" fontSize="10" value="Select" />
                <Picker.Item label="Select State" color="#B3B3B3" fontSize="10" value="Self-care" />
                <Picker.Item label="JavaScript" color="#B3B3B3" fontSize="10" value="Car-care" />
              </Picker>
            </View>

            <Text style={styles.textLabel}> Category  </Text>
            <View style={{ borderRadius: 4, borderWidth: 1, borderColor: 'gray', width: "94%", backgroundColor:'#ffffff' }}>
              <Picker 
              style={{height:36}}
              mode="dropdown"              
                //selectedValue={selectedValue}      
                onValueChange={(itemValue, itemIndex) => setSelectedValue(itemValue)}                        >
                <Picker.Item label="Select State" color="#B3B3B3" fontSize="10" value="Select Category" />
                
              </Picker>
            </View>

            <Text style={styles.textLabel}> SubCategory </Text>
            <View style={{ borderRadius: 4, borderWidth: 1, borderColor: 'gray', width: "94%", backgroundColor:'#ffffff' }}>
              <Picker 
              style={{height:36}}
              mode="dropdown"              
                //selectedValue={selectedValue}      
                onValueChange={(itemValue, itemIndex) => setSelectedValue(itemValue)}                        >
                <Picker.Item label="Select State" color="#B3B3B3" fontSize="10" value="Select Category" />
              </Picker>
            </View>

            <Text style={styles.textLabel}> Select Place </Text>
            <View style={{ borderRadius: 4, borderWidth: 1, borderColor: 'gray', width: "94%", backgroundColor:'#ffffff' }}>
              <Picker 
              style={{height:36}}
              mode="dropdown"              
                //selectedValue={selectedValue}      
                onValueChange={(itemValue, itemIndex) => setSelectedValue(itemValue)}                        >
                <Picker.Item label="Select State" color="#B3B3B3" fontSize="10" value="Select Category" />
                <Picker.Item label="Select State" color="#B3B3B3" fontSize="10" value="Home" />
                <Picker.Item label="Select State" color="#B3B3B3" fontSize="10" value="Shope" />
                <Picker.Item label="Select State" color="#B3B3B3" fontSize="10" value="Both" />
              </Picker>
            </View>
            <Text style={styles.textLabel}> CR Number </Text>
            <TextInput
              style={styles.textInput}
              placeholder="Enter CR Number"
              onChangeText={text => this.setState({ cr_number: text })}
            />

            <Text style={styles.textLabel}> City </Text>
            <TextInput
              style={styles.textInput}
              placeholder="Enter City"
              onChangeText={text => this.setState({ city: text })}
            />

            <Text
              style={styles.textLabel}> Country </Text>
            <TextInput
              style={styles.textInput}
              placeholder="Enter Country"
              onChangeText={text => this.setState({ country: text })}
            />

            <Text
              style={styles.textLabel}> Passowrd </Text>
            <TextInput
              style={styles.textInput}
              placeholder="Enter Passowrd"
              onChangeText={text => this.setState({ password: text })}
            />

            <Text
              style={{
                fontSize: 13,
                marginBottom: 2,
                marginTop: 8,
                color: "#444",
                fontWeight: 'bold'
              }}>
              I agree to<Text style={{ color: "#00C8E4" }}> Terms & Conditions</Text> of Self Care & Car Care
                </Text>

            <View style={[{
              width: "94%",
              marginStart: 10,
              marginEnd: 10,
              marginTop: 24,
              marginBottom: 16,
              backgroundColor: "#00C8E4",
              borderRadius: 6,
            }]}>
              <Button
                title="Sign Up"
                color="#00C8E4"
                onPress={() =>
                  this.submitHandle()
                }
              />
            </View>

            <Text
              style={{
                fontSize: 16,
                marginBottom: 16,
                color: "#808080"
              }}>Sign in with Social Account</Text>


            <View style={styles.buttonContainer}>
              <View style={styles.socialButtonContainer}>
                <TouchableOpacity style={styles.centerAlign}>
                  <Image style={styles.socialIcon} source={require('../assets/2-Login/fb.png')} />
                  <Text style={[styles.textButtonSocial, { color: '#FFFFFF' }]}>Facebook</Text>
                </TouchableOpacity>
              </View>

              <View style={[styles.socialButtonContainer, { backgroundColor: '#FFFFFF' }]}>
                <TouchableOpacity style={styles.centerAlign}>
                  <Image style={styles.socialIcon} source={require('../assets/2-Login/goolge.png')} />
                  <Text style={styles.textButtonSocial}>Google</Text>
                </TouchableOpacity>
              </View>
            </View>


            <Text
              style={{
                fontSize: 16,
                marginBottom: 48,
                marginTop: 32,
                color: "#1A1A1A"
              }}>Already have an account?
                <TouchableOpacity onPress={() => { navigation.navigate("Login") }}>
                <Text style={{ color: "#00C8E4" }}> Sign In </Text>
              </TouchableOpacity>
            </Text>
            <StatusBar style="auto" />
          </View>
        </ScrollView>
      </ImageBackground>
    );
  }
};

